import React, { Component, Fragment } from 'react';
import { Wrapper, Dates, RegisterButton } from './CampCard.styled.js';

class CampCard extends Component {
  constructor(props){
    super(props);
    this.state={};
  }

  render() {
    return (
      <Wrapper>
        <Dates>September 26/27</Dates>
        <RegisterButton href="www.google.com">Register Now!</RegisterButton>
      </Wrapper>
    );
  }
}

export default CampCard;
